const Search = () => {
  return (
    <>
      <input
        type="text"
        placeholder="City"
        value={input}
        className={homepageStyles.input}
        onChange={(ev) => handleChange(ev)}
      />
      <Link href={`/city/weather?city=${input}`}><a className={homepageStyles.search}>Search</a></Link>
    </>
  )
}

export default Search;
